import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from 'react-router-dom';
import Banner from './Components/Banner/banner';

import MainHeader from './Components/MainHeader';
import Login from './Pages/Login';


function App() {
  return (

      <Router>

      <MainHeader/>
    <Banner/>
    <Route path="/login">
      <Login/>
    </Route>


    </Router>
  );
}

export default App;
















